import React, { useEffect, useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'font-awesome/css/font-awesome.min.css';
import './assets/css/light-bootstrap-dashboard.css'; // Pastikan file ada
import './assets/css/demo.css'; // Jika ingin demo style
import logoIndoexpress from './assets/img/logo-indoexpress.png'; // Import logo lokal

const DashboardLayout = ({ children }) => {
  const [time, setTime] = useState({
    hours: '00',
    minutes: '00',
    seconds: '00',
  });

  useEffect(() => {
    const updateClock = () => {
      const now = new Date();
      setTime({
        hours: String(now.getHours()).padStart(2, '0'),
        minutes: String(now.getMinutes()).padStart(2, '0'),
        seconds: String(now.getSeconds()).padStart(2, '0'),
      });
    };
    const interval = setInterval(updateClock, 1000);
    updateClock(); // initial call
    return () => clearInterval(interval);
  }, []);

  return (
    <div className="wrapper">
      <div className="sidebar" data-image="/assets/img/sidebar-5.jpg" data-color="blue">
        <div className="sidebar-wrapper">
          <div className="logo">
            <a href="#" className="simple-text">
              <img src={logoIndoexpress} alt="Indoexpress Logo" className="img-fluid" />
            </a>
          </div>
          <ul className="nav">
            <li className="nav-item">
              <div className="nav-link text-white text-center">
                <h2 className="my-0">
                  {time.hours}:{time.minutes}:{time.seconds}
                </h2>
              </div>
            </li>
            <li className="nav-item active">
              <a className="nav-link" href="#">
                <i className="nc-icon nc-chart-pie-35"></i>
                <p>Dashboard</p>
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">
                <i className="nc-icon nc-circle-09"></i>
                <p>Profil</p>
              </a>
            </li>
            {/* Tambah menu lainnya sesuai level user jika backend nanti sudah tersedia */}
            <li className="nav-item">
              <a className="nav-link" href="#">
                <span>
                  Log out <i className="nc-icon nc-button-power"></i>
                </span>
              </a>
            </li>
          </ul>
        </div>
      </div>

      <div className="main-panel">
        {/* Navbar */}
        <nav className="navbar navbar-expand-lg">
          <div className="container-fluid">
            <a className="navbar-brand" href="#">Absensi</a>
            <button className="navbar-toggler navbar-toggler-right" type="button">
              <span className="navbar-toggler-bar burger-lines"></span>
              <span className="navbar-toggler-bar burger-lines"></span>
              <span className="navbar-toggler-bar burger-lines"></span>
            </button>
          </div>
        </nav>

        {/* Content */}
        <div className="content">
          <div className="container-fluid">
            <div id="alert">
              {/* Alert message placeholder (can be set with state) */}
            </div>
            {children}
          </div>
        </div>

        {/* Footer */}
        <footer className="footer">
          <div className="container">
            <nav>
              <p className="copyright text-center">
                &copy; 2024 <a href="http://indoexpress.co.id">Indoexpress</a>
              </p>
            </nav>
          </div>
        </footer>
      </div>
    </div>
  );
};

export default DashboardLayout;
